1. Open your hardware wallet; 
2. Go to homepage, click“Function -> Binding”；
3. Select the chains to be bound, click“OK” button, enter the password, and generate a binding QR code; 
4. Click “Scan To Bind”button below to scan all QR code pages.

1. Open your hardware wallet; 
2. Go to homepage, click“more -> binding”；
3. Select the chains to be bound, click“OK” button, enter the password, and generate a binding QR code; 
 4. Click “Scan To Bind”button below to scan all QR code pages.

1. Open the hardware wallet;
2. Open the system menu and select "Monitor Account";
3. Select the currency to be monitored and click the "Transfer to APP" button to transfer it using the QR code or NFC function;
 n4. Click the "Scan QR code binding" or "NFC binding" button below and follow the prompts to bind.

1. Open the hardware wallet;
2. Click "Menu"->"Monitor Account";
3. Select the currency to be bound and click the "Transmit to Kushen APP" button to display the QR code;
4. Click Click the "Scan QR code to bind" button at the bottom of the APP to scan all QR codes of the hardware wallet.

1. Open your hardware wallet；
2. Click “Function” -> “Monitor Account”;
3. Select the coins to be bound and click the “Export” button to show the QR code;
4. Click “Scan To Bind” button below to scan the QR codes.

1. Open your hardware wallet;
2. Select coin, then jump to the “Receive” page; 
3. Enter “My Addresses” list, then select the address to be bound.
4. Jump to the “Balance” page, then click “REFRESH” button to show the QR code;
5. Click "Scan To Bind" button below to scan the QR code.

1. Open your hardware wallet；
2. Click “Function” -> “Export Address”; 
3. Select the address to be bound and click the “Export” button to show the QR code; 
4. Click “Scan To Bind” button below to scan the QR code.
